var promisesCapability = typeof Promise !== 'undefined' && typeof Promise.resolve === 'function' && Promise.resolve(0) &&
 typeof Promise.resolve(0).then === 'function';

function loadScript(fileName) {
  var scriptElement = document.createElement('script');
  scriptElement.setAttribute('src', getScriptSrc(fileName));
  scriptElement.setAttribute('type', 'text/javascript');
  scriptElement.setAttribute('async', 'false');
  scriptElement.setAttribute('defer', 'defer');
  var body = document.getElementsByTagName('body')[0];
  body.appendChild(scriptElement);
}

function getScriptSrc(fileName) {
  var prefix = sharedClipboardSettings.staticContentURLPrefix;
  if (!prefix) {
    return fileName;
  }

  var queryMark = prefix.indexOf('?');
  if (queryMark < 0) {
    return prefix + fileName;
  }

  var postfix = prefix.substr(queryMark);
  prefix = prefix.substr(0, queryMark);
  return prefix + fileName + postfix;
}
